// TokenName returns the constant name for a token ID
func TokenName(tok int) string {
	if name, ok := tokenNameMap[tok]; ok {
		return name
	}
	if tok > 0 && tok < 256 {
		return string(rune(tok))
	}
	return fmt.Sprintf("TOKEN_%d", tok)
}
